import { AppBar , Toolbar, Typography } from '@mui/material';

const Navbar = () => {
    return (
        <AppBar>
            <Toolbar>
                <Typography>Code for Interview</Typography>
                <Typography>All Users</Typography>
                <Typography>Add User</Typography>
            </Toolbar>
        </AppBar>
        
    )
}

export default Navbar;
